Morbius: Uncanny X-Force v2 #8
Publisher:  Marvel
Publication Date:  July 17, 2013

Writer:  Sam Humphries
Artists:  Adrian Alphona and Dalibor Talajic
Colorists:  Chris Sotomayor and Lee Loughridge
Letterer:  Cory Petit
Cover Artist:  Kris Anka

The Fantomex Love Pentagram explodes! With the truth about their sordid past fully revealed, can Fantomex, Psylocke, and Cluster look each other in the eye? Every psychic ninja needs a vicious animal with no impulse control and a short temper to back her up...right? Puck! Plus: a terrifying surprise villain from the X-past!

